import "./PanelBtn.scss";
export const PanelBtn = (props) => {
  return (
    <button
      type="button"
      className="btn-panel-slide"
      data-position={props["data-position"]}
      onClick={() => props.onClick(props["data-position"])} // 함수로 전달
    >
      {props["data-position"] === "left" ? "Left" : "Right"}
    </button>
  );
};
